// Create a Pixi Application
let app = new PIXI.Application({ 
    width: 800, 
    height: 640,                       
    antialias: true, 
    transparent: false, 
    resolution: 1
});

// Add the canvas that Pixi automatically created for you to the HTML document
document.body.appendChild(app.view);

// Define paddles
let paddleLeft = new PIXI.Graphics();
paddleLeft.beginFill(0xFFFFFF);
paddleLeft.drawRect(0, 0, 20, 100);
paddleLeft.endFill();
paddleLeft.x = 30;
paddleLeft.y = app.screen.height / 2 - 50;
app.stage.addChild(paddleLeft);

let paddleRight = new PIXI.Graphics();
paddleRight.beginFill(0xFFFFFF);
paddleRight.drawRect(0, 0, 20, 100);
paddleRight.endFill();
paddleRight.x = app.screen.width - 50;
paddleRight.y = app.screen.height / 2 - 50;
app.stage.addChild(paddleRight);

// Define ball
const ballSpriteImg = 'data:image/png;base64,';
let ball = PIXI.Sprite.from(ballSpriteImg);
ball.scale.set(0.18); // Imposta la scala della pallina (0.1 volte la dimensione originale)
ball.anchor.set(0.5); // Imposta il punto di ancoraggio al centro della pallina
ball.x = app.screen.width / 2;
ball.y = app.screen.height / 2;
app.stage.addChild(ball);

// Define paddles' velocities
let paddleVelocity = 7;

// Define ball's velocity
let ballVelocity = {
    x: 5,
    y: 5
};

// Define scores
let scoreLeft = 0;
let scoreRight = 0;

// Create score texts
let scoreTextLeft = new PIXI.Text(scoreLeft, { fill: 0xFFFFFF });
scoreTextLeft.x = 100;
scoreTextLeft.y = 10;
app.stage.addChild(scoreTextLeft);

let scoreTextRight = new PIXI.Text(scoreRight, { fill: 0xFFFFFF });
scoreTextRight.x = app.screen.width - 100;
scoreTextRight.y = 10;
app.stage.addChild(scoreTextRight);

// Function to update game logic
function update(delta) {
    // Move paddles
    if (app.keyboard.isKeyDown(87)) { // "W" key
        paddleLeft.y -= paddleVelocity;
    }
    if (app.keyboard.isKeyDown(83)) { // "S" key
        paddleLeft.y += paddleVelocity;
    }
    if (app.keyboard.isKeyDown(38)) { // Up arrow key
        paddleRight.y -= paddleVelocity;
    }
    if (app.keyboard.isKeyDown(40)) { // Down arrow key
        paddleRight.y += paddleVelocity;
    }

    // Ensure paddles stay within screen boundaries
    if (paddleLeft.y < 0) {
        paddleLeft.y = 0;
    }
    if (paddleLeft.y > app.screen.height - paddleLeft.height) {
        paddleLeft.y = app.screen.height - paddleLeft.height;
    }
    if (paddleRight.y < 0) {
        paddleRight.y = 0;
    }
    if (paddleRight.y > app.screen.height - paddleRight.height) {
        paddleRight.y = app.screen.height - paddleRight.height;
    }

    // Move ball
    ball.x += ballVelocity.x;
    ball.y += ballVelocity.y;

    // Check collision with walls
    if (ball.y <= 0 || ball.y >= app.screen.height) {
        ballVelocity.y *= -1;
    }

    // Check collision with paddles
    if (ball.x <= paddleLeft.x + paddleLeft.width &&
        ball.y >= paddleLeft.y &&
        ball.y <= paddleLeft.y + paddleLeft.height) {
        ballVelocity.x *= -1;
    }

    if (ball.x >= paddleRight.x - ball.width &&
        ball.y >= paddleRight.y &&
        ball.y <= paddleRight.y + paddleRight.height) {
        ballVelocity.x *= -1;
    }

    // Check for scoring
    if (ball.x <= 0) {
        scoreRight++;
        resetBall();
    } else if (ball.x >= app.screen.width) {
        scoreLeft++;
        resetBall();
    }

    // Update score texts
    scoreTextLeft.text = scoreLeft;
    scoreTextRight.text = scoreRight;
}

// Function to reset ball position
function resetBall() {
    ball.x = app.screen.width / 2;
    ball.y = app.screen.height / 2;
    ballVelocity.x *= -1;
    ballVelocity.y = Math.random() > 0.5 ? 5 : -5; // Randomize ball's initial vertical velocity
}

// Start the game loop
app.ticker.add(delta => update(delta));

// Extend PIXI's built-in keyboard handling
PIXI.Application.prototype.keyboard = {
    _keydown: {},
    isKeyDown: function(key) {
        return this._keydown[key];
    },
    _onKeyDown: function(event) {
        this._keydown[event.keyCode] = true;
    },
    _onKeyUp: function(event) {
        this._keydown[event.keyCode] = false;
    },
    _onWindowBlur: function() {
        this._keydown = {};
    },
    _enable: function() {
        window.addEventListener('keydown', this._onKeyDown.bind(this));
        window.addEventListener('keyup', this._onKeyUp.bind(this));
        window.addEventListener('blur', this._onWindowBlur.bind(this));
    }
};

app.keyboard._enable();
